        <div className='divider'></div>
        <input type="text" placeholder='Enter Bathrooms' />
        <div className='divider'></div>
        <button className='login-button' >show Location chart </button>
        <button className='login-button'>Predict</button>
        <h1>{data}</h1>
      </form>
      </div>
      </div>
      ) 
}

export default Predictinput
